INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 7, "ペコリーヌとの出会い", 2834, 5118061, "青空の下で謁見", 10118, 0, 2, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 7, "マホとの出会い", 2835, 5118062, "未来の騎空団\nマスコット？", 10118, 0, 2, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "ランドソル市街地", 40, 7, "アキノとの出会い", 2837, 5118063, "お嬢さまからの\n緊急依頼", 10118, 0, 2, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 18, "ジュンとの出会い", 4108402, 5118064, "黄金色の悩みごと", 10118, 0, 2, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 18, "カオリとの出会い", 4107402, 5118065, "白熱！　格闘大会！", 10118, 0, 2, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "オーエド町", 40, 16, "ニノンとの出会い", 9000227, 5118066, "祭り太鼓はオーエドの華", 10118, 1, 2, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 19, "スズナとの出会い", 2101181, 5118067, "人気者は遅れて\nやってくる", 10118, 0, 3, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "ランドソル市街地", 40, 18, "ナナカとの出会い", 4109402, 5118068, "巫女・ミーツ・魔法少女", 10118, 0, 3, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 18, "キャル＆コッコロとの出会い", 4305402, 5118069, "ネズ耳は二度なくなる", 10118, 0, 3, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "ランドソル市街地", 40, 18, "ユカリとの出会い", 4101402, 5118070, "この出会いにカンパイ！", 10118, 0, 3, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "ランドソル市街地", 40, 18, "アオイとの出会い", 4106402, 5118071, "陰陽アンサンブル", 10118, 0, 3, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (91002, 8, "フリーマーケット会場", 40, 7, "シノブとの出会い", 2836, 5118072, "運試し十番勝負！", 10118, 1, 3, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 0, 1);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES (0, 0, 0, 0, 0, "オープニング", 0, 5118600, "彼女たちの新たな日常", 10118, 0, 1, 0, 10145115, 0);
